pragma solidity ^0.8.0;

contract Voting {
    struct Vote {
        address voter;
        uint candidate;
    }

    mapping(address => uint) public votes; // Mapping để lưu trữ phiếu bầu của mỗi người dùng
    mapping(uint => uint) public candidateVotes; // Mapping để lưu trữ số phiếu của từng ứng viên
    mapping(uint => bool) public validCandidates; // Mapping để lưu trữ các ứng cử viên hợp lệ
    address[] public voters; // Danh sách các địa chỉ đã bỏ phiếu
    uint public startTime; // Thời gian bắt đầu cuộc tranh cử
    uint public endTime; // Thời gian kết thúc cuộc tranh cử

    constructor(uint[] memory candidateIds, uint _startTime, uint _endTime) {
        require(_startTime < _endTime, "Start time must be before end time");
        startTime = _startTime;
        endTime = _endTime;
        for (uint i = 0; i < candidateIds.length; i++) {
            validCandidates[candidateIds[i]] = true;
        }
    }

    modifier onlyDuringVotingPeriod() {
        require(block.timestamp >= startTime && block.timestamp <= endTime, "Voting is not allowed outside the voting period");
        _;
    }

    function vote(uint candidate) public onlyDuringVotingPeriod {
        require(validCandidates[candidate], "Invalid candidate");

        if (votes[msg.sender] != 0) {
            // Nếu người dùng đã bỏ phiếu trước đó, giảm số phiếu của ứng viên cũ
            candidateVotes[votes[msg.sender]] -= 1;
        } else {
            // Nếu đây là lần đầu tiên người dùng bỏ phiếu, thêm địa chỉ của họ vào danh sách voters
            voters.push(msg.sender);
        }

        // Cập nhật phiếu bầu của người dùng
        votes[msg.sender] = candidate;
        candidateVotes[candidate] += 1;
    }

    function getVotes() public view returns (Vote[] memory) {
        Vote[] memory allVotes = new Vote[](voters.length);
        for (uint i = 0; i < voters.length; i++) {
            allVotes[i] = Vote(voters[i], votes[voters[i]]);
        }
        return allVotes;
    }

    function getCandidateVotes(uint candidate) public view returns (uint) {
        return candidateVotes[candidate];
    }
}
